import { BrowserRouter, Route, Switch } from "react-router-dom";
import LoginPage from "./Containers/LoginPage";

function App() {
  return (
    <div className="AppDiv">
      <BrowserRouter>
        <Switch>
          <Route exact path="/login">
            <LoginPage />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
